import React from 'react'

function Loginpage() {
  return (
<div className="main">
  <form action="" className="loginform">
    <h1>Sign In</h1>
    <input type="Username" className='input1' required placeholder='Enter Username' />
    <input type="Password" className='input1' required placeholder='Enter Username' />
  </form>
</div>
  )
}

export default Loginpage
